import { Card } from "antd";

export const DataTile = () => {
  return (
    <Card
      style={{
        borderRadius: "8px",
        width: "200px",
        height: "200px",
        margin: "2rem",
      }}
    >
      <h1>110 PiB</h1>
      <h2>Total Capacity</h2>
    </Card>
  );
};

export default DataTile;
